extern uint8_t g_lcd_ram[DRV_LCD_HIGHT*2][DRV_LCD_WIDTH/2];

void lib_display_ascii(char *p_char, uint8_t char_len, _lib_display_param *param)
{

	_drv_lcd_graph graph =
	{
		.x = param->x,
		.y = param->y,
		.height = param->height*2,
	};
	_df_dot_param dot_param =
	{
		.bg_color = param->bg_color,
		.fg_color = param->fg_color,
	};

	if(param->height == 16)
	{
		dot_param.height = 16;
		dot_param.width = 1;
		for(uint8_t i=0;i<char_len;i++)
		{
			dot_param.dot = (uint8_t *)df_16X8_ascii[*p_char-0x20];
			df_conversion_color(&graph, &dot_param);
			p_char++;
			graph.y += 4+param->gap;
		}		
	}
	else if(param->height == 48)
	{
		dot_param.height = 48;
		dot_param.width = 3;
		for(uint8_t i=0;i<char_len;i++)
		{
			if(*p_char == '%')
			{
				dot_param.dot = (uint8_t *)df_48X24_percent;
			}
			else{
				dot_param.dot = (uint8_t *)df_48X24_num[*p_char-0x30];
			}
			df_conversion_color(&graph, &dot_param);		
			p_char++;
			graph.y += 12+param->gap;
		}		
	}	

}






