void lib_display_point_example(void)
{
	static uint16_t x_offset = 50;
	static uint16_t y_offset = 50;
	lib_gfx_point_t p_point = LIB_GFX_POINT(x_offset,y_offset);
	lib_gfx_point_draw(&p_point,LIB_DISPLAY_COLOR_11);			
	_drv_lcd_graph graph =
	{
		.x = x_offset,
		.height = 4,
	};
	drv_lcd_set_one_frame(&graph);	

	x_offset += 2;
	y_offset++;		
}
void lib_display_line_example(void)
{
	static uint16_t x_start = 240 - 100;
	static uint16_t y_start = 120 - 50;
	static uint16_t x_end = 240;
	static uint16_t y_end = 120;			
	lib_gfx_line_t p_line = LIB_GFX_LINE(x_start, y_start, x_end, y_end, 2);
	lib_gfx_line_draw(&p_line,LIB_DISPLAY_COLOR_11);
	_drv_lcd_graph graph =
	{
		.x = x_start,
		.height = ((x_end-x_start)?(x_end-x_start):1)*2,
	};
	drv_lcd_set_one_frame(&graph);	
}
void lib_display_rect_example(bool fill)
{
	static uint16_t x_start = 50*2;
	static uint16_t y_start = 50*2;
	static uint16_t width = 50;
	static uint16_t height = 50*2;	
	lib_gfx_rect_t p_rect = LIB_GFX_RECT(x_start, y_start, width, height);
	lib_gfx_rect_draw(&p_rect,1,LIB_DISPLAY_COLOR_11,fill);	
	
	
	_drv_lcd_graph graph =
	{
		.x = x_start,
		.height = height*2,
	};
	drv_lcd_set_one_frame(&graph);	
}



void lib_display_circle_example(bool fill)
{
	static uint16_t x_center = 120-2;
	static uint16_t y_center = 120-2;			
	static uint16_t radius = 50;	
	lib_gfx_circle_t p_circle = LIB_GFX_CIRCLE(x_center, y_center, radius);
	lib_gfx_circle_draw(&p_circle,LIB_DISPLAY_COLOR_11,fill);
	_drv_lcd_graph graph =
	{
		.x = x_center-radius,
		.height = (x_center+radius*2)*2,
	};
	drv_lcd_set_one_frame(&graph);	
}
